DPR:
Create a consolidated dataset of the company’s property, plant and equipment (PP&E) that includes, for each fiscal year (at minimum 2018 and 2019):  
1) the gross amounts for each asset class (land, buildings and improvements, machinery and equipment, warehouse equipment, vehicles, construction in progress, leasehold improvements, computer equipment, furniture, fixtures and other equipment, and any other listed categories);  
2) the accumulated depreciation/amortization for each class and the resulting net PP&E values;  
3) a geographic breakdown of net PP&E (U.S., United Kingdom, South Africa, Australia, Other, and total) for the same years;  
4) calculated fields showing the absolute and percentage change in each asset class, each regional net total, and the overall net PP&E between 2018 and 2019; and  
5) derived indicators that count the number of years each asset class exceeds specified monetary thresholds (e.g., $200 million for machinery, $10 million for furniture). The dataset should be structured to support queries that retrieve raw values, compute year‑over‑year differences, and perform threshold‑based analyses across asset types and regions.
